  input: '"TEXT","F3XA","C00014498","THIS FILING IS INTENDED TO BE PART OF OUR JULY
    31, 2005 MID-YEAR REPORT .  All expenditures made by the committee during this
    period are generic. The Federal election disbursements repoted herein relates
    to the 2004 general election. During the period covered by this report, no committee
    employee spent 25 percent or more of his or her time on activities related to
    a Federal election. In July 2005 the committee began federal election activity
    leading to the 2006 general election.  Accordingly, on August 20, 2005 the committee
    will begin filing monthly FEC disclosure reports commencing with the report for
    the period July 1, 2005 through July 31, 2005.   The Committee hereby incorporates
    by reference Form 99 Miscellaneous Report, an April 22,2002 electronic filing
    that outlines the policies followed by the party in its effort to obtain the full
    name, address, occupation and employer for each contributor.  The Committee also
    hereby incorporates by reference Form 99 Miscellaneous Report, a May 31, 2003
    electronic filing that clarifies the partys policy relating to payments received
    from candidates for goods and services provided by the party to said candidates."'
